/**
 * Thông tin thông báo
 * @param {string} message Thông báo
 */
function MessageModal(message) {
    document.getElementById('message').innerHTML = message === null ? "" : message;
    //$('#MessageModal').modal('show');
    try {
        var val_message = $('#message').text();
        if (val_message !== '' && val_message !== '' && val_message !== undefined && val_message !== null && val_message.length > 1) {
            $('#MessageModal').modal('show');
        }
    } catch (e) {
        document.getElementById('message').innerHTML = 'Sai định dạng message! ';
        $('#MessageModal').modal('show');
    }
    //$(".modal-backdrop").attr('style', 'z-index:-2 !important;');
    //$('#page-wrapper').css("z-index", "2");
}

function addModalMessage() {
    $('#AddModalMessage').children().remove();
    s = '';
    s += '<div class="modal fade message-modal" id="MessageModal" role="dialog" data-backdrop="static" data-keyboard="false">'
        + '<div class="modal-dialog">'
        + '<div class="modal-content">'
        + '<div class="modal-header">'
        + '<button type="button" class="close" data-dismiss="modal">&times;</button>'
        + '<h4 class="modal-title">Thông báo</h4>'
        + '</div>'
        + '<div class="modal-body">'
        + '<p id="message"></p>'
        + '</div>'
        + '<div class="modal-footer">'
        + '<button type="button" class="btn btn-default" data-dismiss="modal">Đóng</button>'
        + '</div>'
        + '</div>'
        + '</div >'
        + '</div >';
    var divModalMessage = $('#AddModalMessage');
    divModalMessage.append(s);
}
/**
 * --------------------------------------------------------------------------
 * Alert
 * --------------------------------------------------------------------------
 */
var Alert = new Alerts();
function Alerts() {
    this.Add = function (ParentId, MessageContent, MessageType) {
        addAlertHtml(ParentId, MessageType, MessageContent);
    };
}
function addAlertHtml(ParentId, MessageType, MessageContent) {
    $('#AlertDefault').remove();
    if (ParentId) {
        var s = '<div id="AlertDefault" class="alert alert-' + MessageType + ' alert-dismissible fade show" role="alert">' + MessageContent +
            '<button type="button" class="close" data-dismiss="alert" aria-label="Close">' +
            '<span aria-hidden="true">&times;</span>' +
            '</button>' +
            '</div>';
        $('#' + ParentId).append(s);
    }
    else {
        var s1 = '<div id="AlertDefault" class="alert alert-' + MessageType + ' alert-dismissible fade show" role="alert">' + MessageContent +
            '<button type="button" class="close" data-dismiss="alert" aria-label="Close">' +
            '<span aria-hidden="true">&times;</span>' +
            '</button>' +
            '</div>';
        $('body').append(s1);
    }
    $('.alert').alert();
    window.setTimeout(function () {
        $('#AlertDefault').remove();
    }, 5000);
}
/**
 * --------------------------------------------------------------------------
 * Loadding
 * --------------------------------------------------------------------------
 */
var Loadding = new Loaddings();
function Loaddings() {
    this.Show = function (Content, LoadingIcon) {
        AddLoadding(Content, LoadingIcon);
        $("#AjaxLoader").css("display", "flex");
    },
        this.Hide = function () {
            $("#AjaxLoader").css("display", "none");
        };
}
function AddLoadding(Content, LoadingIcon) {
    $('#AjaxLoader').remove();
    if (!$('#AjaxLoader').val()) {
        s = '<div id="AjaxLoader" style="display: flex;width: 100vw;height: 100vh;top: 0;left: 0;z-index: 15000;padding-top: 20px;background-color: rgba(122, 120, 120, 0.34);border-radius: 5px;text-align: center;box-shadow: grey 1px 1px 1px;border: 1px solid rgb(230, 230, 230);" class="position-fixed">' +
            '<div style="height: 100px;margin: auto;width:360px;padding-top: 15px;box-shadow: 0 5px 10px #8a8a8ab8;background-color: white;border-radius: 5px;">' +
            '<img style="max-width:32px; max-height:32px" src="' + LoadingIcon + '"/>' +
            '<div class="loadding-content" style="margin-top:10px">' + Content + '</div>' +
            '</div>' +
            '</div>';
        $('body').append(s);
    }
    if (!Content) {
        Content = 'Đang xử lý...';
        $('.loadding-content').empty();
        $('.loadding-content').html(Content);
    }
}

